package zhiyuan.com.loan.bean;import cn.bmob.v3.BmobObject;/** * Created by haijun on 2016/4/20. */public class ArticleCollection extends BmobObject {    private String userId;    private String articleId;    private String collectId;    private int type;    public String getUserId() {        return userId;    }    public void setUserId(String userId) {        this.userId = userId;    }    public String getCollectId() {        return collectId;    }    public void setCollectId(String collectId) {        this.collectId = collectId;    }    public String getArticleId() {        return articleId;    }    public void setArticleId(String articleId) {        this.articleId = articleId;    }    public int getType() {        return type;    }    public void setType(int type) {        this.type = type;    }}